  \"2016-11-25T21:06:26.226011\",\n\t\"name\": \"2006-national-assessment-of-educational-progress\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2006 (NAEP 2006), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2006 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in various subject areas. The study
  was conducted using computer-based assessment of students. Students in grade 4,
  8, and 12 were sampled. NAEP 2006 assessments consist of national assessments in
  civics and U.S. history at grades 4, 8, and 12, and economics at grade 12. The studyufffdufffds
  response rate was between 78 and 86 percent. Key statistics produced from NAEP 2006
  are results on subject-matter achievement, instructional experiences, and school
  environment for populations of students (e.g., all fourth-graders) and groups within
  those populations (e.g., female students, Hispanic students).\",\n\t\"license_title\":
